package com.spring.api.service.domain;public class CustomerInfo {    private int id;    private String number;    private String email;    private String birthday;    private String created_at;    private String updated_at;    private String billingFirstName;    private String billingLastName;    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getNumber() {        return number;    }    public void setNumber(String number) {        this.number = number;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getBirthday() {        return birthday;    }    public void setBirthday(String birthday) {        this.birthday = birthday;    }    public String getCreated_at() {        return created_at;    }    public void setCreated_at(String created_at) {        this.created_at = created_at;    }    public String getUpdated_at() {        return updated_at;    }    public void setUpdated_at(String updated_at) {        this.updated_at = updated_at;    }    public String getBillingFirstName() {        return billingFirstName;    }    public void setBillingFirstName(String billingFirstName) {        this.billingFirstName = billingFirstName;    }    public String getBillingLastName() {        return billingLastName;    }    public void setBillingLastName(String billingLastName) {        this.billingLastName = billingLastName;    }}